import { connect } from "react-redux";
import Behaviors from "../components/Behaviors";

export const mapStateToProps = (state) => {
  return{

   addBehavior : (behavior) => dispatch(addBehavior(behavior))
  }
};
export default connect(null, mapDispatchToProps, null)(Behaviors);
